import React from 'react'
import Twitch from '../assets/twitch.png'

const Potrait2 = () => {
  return (
    <div className='flex  bg-white mx-auto'>
    <div className='flex w-[20%] bg-none mx-auto'>
    <div className=' max-w-[1240px] mx-auto  grid md:grid-cols-2 '></div>
   <img className='mx-auto pb-10' src={Twitch} alt="/" />


   </div>
   </div>

  )
}

export default Potrait2
